import './App.css';
import BetaLogo from './images/realbeta.gif';



function App() {
  return (
    <>

      <div className="flex-container">

        <nav className="navbar">
          <img className="navlogo" src={BetaLogo} alt="BetaClass"></img>
          <ul className="navlist">
            <li className="navlist-items active"><a href="#why betaclass">Why BetaClass</a></li>
            <li className="navlist-items"><a href="#getting started">Getting Started</a></li>
            <li className="navlist-items active"><a href="#pricing">Pricing</a></li>
            <li className="navlist-items"><a href="#contact">Contact US</a></li>
            <li className="navlist-items active"><a href="#doc">Doc</a></li>
            <li className="navlist-items"><a href="#support">Support</a></li>
            <li className="navlist-items"><a href="#faq">FAQ</a></li>
            <button className="button-item"><a href="#contact">Get Started for free</a></button>
          </ul>
        </nav>
      </div>

      <div className="body">

      </div>

    </>
  );
}

export default App;
